insert into PRD_BANKFINANCE values (null, '00045849', '“锦程盈利”2012年22号人民币61天理财产品', '成都银行', '人民币', '61天', '2012-10-17', '2012-10-10', '2012-10-16', '61天', '4.6', '票据型', '5 万元', '浮动收益型', '全国', '10000', '预期年率已扣除相关费用。', '否', '', '1.客户无提前终止权。2.当银行认定市场变化不利于本理财产品运作的情况出现时，银行可提前结束理财产品。', '该产品募集资金对商业银行担保或作为还款人的有价证券或债权（务）协议投资比例不低于90%。该产品为非保本浮动收益型，投资者主要面临信用风险：如果基础资产发行人无法按时足额支付本金和收益，投资者收益甚至本金可能受到损失。该产品适合稳健型、平衡型、进取型、成长型投资者。', '产品预期年收益率为4.60%。',0, null,'2012-09-27 11:38:52.000108');
insert into PRD_BANKFINANCE values (null, '00045896', '2012年“金葵花”-招银进宝之点贷成金1015号理财计划101895', '招商银行', '人民币', '78天', '2012-10-12', '2012-10-08', '2012-10-11', '78天', '4.3', '组合型', '5 万元', '浮动收益型', '福州,厦门', '10000', '无', '否', '', '银行有权提前终止，投资者无提前终止权。', '本理财计划投资于AA级(含)以上信用级别高,流动性好的银行间市场流通债券，信托计划，银行存款等其他金融资产。投资比例区间：债券资产、银行存款：30%—100% ；其他资产不高于70%。', '预期年化收益率为4.30%',0, null,'2012-09-27 11:38:53.772788');
insert into PRD_BANKFINANCE values (null, '00045897', '2012年“金葵花”-招银进宝之点贷成金1016号理财计划101896', '招商银行', '人民币', '45天', '2012-10-12', '2012-10-08', '2012-10-11', '45天', '4.2', '组合型', '10 万元', '浮动收益型', '福州,哈尔滨', '10000', '无', '否', '', '银行有权提前终止，投资者无提前终止权。', '本理财计划投资于AA级(含)以上信用级别高,流动性好的银行间市场流通债券，信托计划，银行存款等其他金融资产。投资比例区间：债券资产、银行存款：30%—100% ；其他资产不高于70%。', '预期年化收益率为4.20%',0, null,'2012-09-27 11:38:55.188761');
insert into PRD_BANKFINANCE values (null, '00045856', '“鑫意”理财福通2012第117期人民币理财产品', '上海农商银行', '人民币', '90天', '2012-10-12', '2012-10-08', '2012-10-11', '90天', '4.4', '票据型', '5 万元', '浮动收益型', '全国', '10000', '预期最高年率已扣除相关费用；实际年化收益率高于4.40%以上部分作为银行管理费用。', '否', '', '1.银行有权提前终止该产品。2.投资者无权提前终止本理财产品，若提前终止则视为违约。', '本理财产品将主要投资于投资级以上债券资产、货币市场金融资产和金融工具、固定收益类信托计划。产品所投资的信托计划投资范围主要为在银行间市场公开发行和上市流通的债券、货币市场工具等，其中，债券发行人的外部主体评级为AA-（含）以上，债项评级为AA-（含）以上或A-1。此外，本理财产品也可投资于银行间市场其他符合监管要求的金融资产和金融工具等。该产品为非保本浮动收益型，上海农村商业银行对该产品的内部风险评级为：中低风险产品。经上海农村商业银行客户风险承受能力评估，该产品适合稳健型、平衡型、成长型、进取型的投资者。', '该理财产品经组合测算，到期后如所投资金融资产可顺利处置，扣除产品托管费用0.05%和交易费用0.01%后，产品预期最高年化收益率为4.40%。',0, null,'2012-09-27 11:38:56.340736');
insert into PRD_BANKFINANCE values (null, '00045857', '“鑫意”理财福通2012第116期人民币理财产品（专属）', '上海农商银行', '人民币', '59天', '2012-10-12', '2012-10-08', '2012-10-11', '59天', '4.3', '票据型', '5 万元', '浮动收益型', '全国', '10000', '预期最高年率已扣除相关费用；实际年化收益率高于4.30%以上部分作为银行管理费用。', '否', '', '1.银行有权提前终止该产品。2.投资者无权提前终止本理财产品，若提前终止则视为违约。', '本款理财产品仅向我行金融便利店客户提供，产品将主要投资于投资级以上债券资产、货币市场金融资产和金融工具、固定收益类信托计划。产品所投资的信托计划投资范围主要为在银行间市场公开发行和上市流通的债券、货币市场工具等，其中，债券发行人的外部主体评级为AA-（含）以上，债项评级为AA-（含）以上或A-1。此外，本理财产品也可投资于银行间市场其他符合监管要求的金融资产和金融工具等。该产品为非保本浮动收益型，上海农村商业银行对该产品的内部风险评级为：中低风险产品。经上海农村商业银行客户风险承受能力评估，该产品适合稳健型、平衡型、成长型、进取型的投资者。', '该理财产品经组合测算，到期后如所投资金融资产可顺利处置，扣除产品托管费用0.05%和交易费用0.01%后，产品预期最高年化收益率为4.30%。',0, null,'2012-09-27 11:38:57.053254');
